import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { signOut } from "firebase/auth";
import { auth } from "../services/firebase";
import "../style/dashboard.css";

function Dashboard() {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const navigate = useNavigate();

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);
  const closeSidebar = () => setSidebarOpen(false);

  const handleLogout = async () => {
    const confirmLogout = window.confirm("Are you sure you want to log out?");
    if (!confirmLogout) return;

    try {
      await signOut(auth);
      navigate("/login");
    } catch (error) {
      console.error("Logout failed:", error);
    }
  };

  return (
    <div className="dashboard-container bg-gradient-to-br from-blue-50 via-indigo-50 to-purple-50">
      <main className="main-content">
        {/* Burger Button */}
        <button className="menu-toggle" onClick={toggleSidebar}>
          ☰
        </button>

        <header>
          <h2>Good Evening!</h2>
          <p>Welcome back to your laundry shop dashboard</p>
          <small>Sunday, September 14th, 2025</small>
        </header>

        {/* Stats Cards */}
        <section className="stats-cards">
          <div className="card">
            <div className="icon green">
              {/* Revenue (Trending Up) */}
              <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M3 17l6-6 4 4 8-8"/>
              </svg>
            </div>
            <div>
              <h4>₱0.00</h4>
              <small>Today's Revenue</small>
            </div>
          </div>

          <div className="card">
            <div className="icon orange">
              {/* Pending (Clock) */}
              <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z"/>
              </svg>
            </div>
            <div>
              <h4>1</h4>
              <small>Pending</small>
            </div>
          </div>

          <div className="card">
            <div className="icon blue">
              {/* Ready (Check Circle) */}
              <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 12l2 2l4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z"/>
              </svg>
            </div>
            <div>
              <h4>2</h4>
              <small>Ready</small>
            </div>
          </div>

          <div className="card">
            <div className="icon purple">
              {/* In Progress (Cube/Box) */}
              <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M20.5 7.5l-8.5-4.5-8.5 4.5m17 0l-8.5 4.5m-8.5-4.5v9l8.5 4.5 8.5-4.5v-9"/>
              </svg>
            </div>
            <div>
              <h4>0</h4>
              <small>In Progress</small>
            </div>
          </div>
        </section>

        {/* Orders Section */}
        <section className="orders">
          <h5>
            {/* Shirt Icon */}
            <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 inline-block mr-2" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M16 4l4 4v12a2 2 0 01-2 2H6a2 2 0 01-2-2V8l4-4m8 0l-4 4-4-4"/>
            </svg>
            Today's Orders (0)
          </h5>
          <div className="empty">
            <p>No orders created today yet</p>
          </div>
        </section>
      </main>
    </div>
  );
}

export default Dashboard;
